/*!

=========================================================
* Light Bootstrap Dashboard React - v2.0.1
=========================================================

* Product Page: https://www.creative-tim.com/product/light-bootstrap-dashboard-react
* Copyright 2022 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/light-bootstrap-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React, { useState } from "react";
import { Container } from "react-bootstrap";
import styles from "./index.module.css";
import Menu from "@mui/material/Menu";
import { MenuItem } from "@mui/material";
import {
  BackupTable,
  FiberNew,
  Help,
  Home,
  Logout,
  ManageAccounts,
  MoneyOff,
  MoneyRounded,
  Report,
  Summarize,
} from "@mui/icons-material";

const Header = () => {
  const [anchorEl, setAnchorEl] = useState(null);

  const handleOpenMenu = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleCloseMenu = () => {
    setAnchorEl(null);
  };

  return (
    <footer className={styles.footer}>
      <Container fluid>
        <ul className={styles.footermenu}>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu}
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <Home
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Home</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <ManageAccounts
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Master</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <MoneyOff
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />
              <span>Transaction</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <FiberNew
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Namu</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <Summarize
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />
              <span> Report</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <BackupTable
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Utility</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <Help
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <spam>Help</spam>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <Logout
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Out</span>
            </a>
          </li>
        </ul>
        <Menu
          id="hover-menu"
          anchorEl={anchorEl}
          keepMounted
          open={Boolean(anchorEl)}
          onClose={handleCloseMenu}
          onMouseLeave={handleCloseMenu}
        >
          <MenuItem onClick={handleCloseMenu}>Option 1</MenuItem>
          <MenuItem onClick={handleCloseMenu}>Option 2</MenuItem>
          <MenuItem onClick={handleCloseMenu}>Option 3</MenuItem>
        </Menu>
        {/* <p className="copyright text-center">
              © {new Date().getFullYear()}{" "}
              <a href="http://www.creative-tim.com">Creative Tim</a>, made with
              love for a better web
            </p> */}
      </Container>
    </footer>
  );
};

export default Header;
